import styled from 'styled-components';


export const Container = styled.header`

  align-items: center;
  background:#009999;
  display: flex;
  justify-content: center;
  margin: 40px 0;
  text-decoration: none;
  font-size: 30px;


  div {
    display: flex;
    align-items: center;

  }

  a {
    margin-left: 10px;
    color: #FFF;
    text-decoration: none;
  }

`;
